import React from "react";
import { Text, StyleSheet, View } from "react-native";

const HomeScreen = () => {

  const Welcome = 'Hello there';
  return (
  <View> 
  <Text style={styles.text}>Hi There</Text>
  <Text>{Welcome}</Text>
  </View>
  );
};

const styles = StyleSheet.create({
  text: {
    fontSize: 30
  }
});

export default HomeScreen;
